import React, { Component } from 'react';
import './App.css';
import { BrowserRouter } from 'react-router-dom';
import Main from './components/MainComponent';
import AuthProvider from "./auth"
import Context from './context'


class App extends Component{
  render(){
    return(
      <AuthProvider>
        <BrowserRouter>
          <div>
            <Main/>
          </div>
        </BrowserRouter>
        </AuthProvider>
    )
  }
}

export default App;
